Here's an overview of the logic in `src/agent.go` and how agents interact with ranking in Zoekt:

```go:src/zoekt/agent.go
// agent.go contains the logic for running search queries across multiple shards in parallel.

// The Agent struct manages a pool of workers that execute searches on individual shards.
type Agent struct {
    // ...
}

// The Search method is the main entry point for executing a search query.
func (x *Agent) Search(ctx context.Context, q query.Q, opts *SearchOptions) (*SearchResult, error) {
    // Create channels for workers to send results
    resCount := 0
    resultChan := make(chan *ShardSearchResult, x.opts.ShardMaxMSizeBytes)

    // Spawn workers to search individual shards in parallel
    for _, shard := range x.shards {
        go x.searchShard(ctx, q, opts, shard, resultChan)
    }

    // Merge results from workers, rank and apply limits
    res := newStreamingSearchResult(q, opts)
    for shardRes := range resultChan {
        res.merge(shardRes)
        resCount += len(shardRes.Files)
        if resCount >= opts.TotalMaxMatchCount {
            break
        }
    }
    res.rankFiles()
    return res.finalize()
}

// searchShard runs the query on a single shard and sends results to resultChan
func (x *Agent) searchShard(ctx context.Context, q query.Q, opts *SearchOptions, shard *shard.Shard, resultChan chan<- *ShardSearchResult) {
    // ...
}
```

The key points are:

1. The `Search` method spawns worker goroutines to execute the search query on individual shards in parallel using `searchShard`.
2. Each worker sends its results to a shared `resultChan` as `ShardSearchResult` values.
3. The main `Search` method collects all `ShardSearchResult` values from `resultChan` and merges them into a `StreamingSearchResult`.
4. After merging, `rankFiles` is called on the `StreamingSearchResult` to rank the files based on the ranking signals.
5. Finally, `finalize` is called to apply any limits and return the final `SearchResult`.

So in summary, agents use a pool of workers to search shards concurrently, then merge and rank the results centrally before returning them.

The ranking logic itself is implemented in the `rankFiles` method of `streaming_search_result.go`. It assigns scores to each file based on signals like number of matching lines, file path, symbols, etc. The details of the ranking algorithm are quite involved.

Goroutines are lightweight threads of execution in Go's runtime. They are a way to achieve concurrency in Go programs, allowing multiple functions to run seemingly simultaneously. Here's how goroutines work:

1. **Creation**: Goroutines are created by the `go` keyword followed by a function call. When the `go` statement is executed, a new goroutine is created and the function call is scheduled to run concurrently with the rest of the program.

```go:main.go
func main() {
    go doSomeWork() // creates a new goroutine
    // main goroutine continues execution
}

func doSomeWork() {
    // function body executed concurrently
}
```

2. **Scheduling**: Go's runtime manages the scheduling of goroutines onto the available logical CPUs. The scheduler is responsible for efficiently multiplexing goroutines onto the available OS threads, allowing them to run concurrently.

3. **Context Switching**: When a goroutine is blocked (e.g., waiting for I/O or a channel operation), the scheduler can switch to another goroutine, allowing the program to make progress. This context switching is lightweight and efficient compared to traditional thread context switching.

4. **Communication**: Goroutines communicate via channels, which are typed conduits through which values can be sent and received. Channels provide synchronization and data exchange between goroutines, allowing them to coordinate their activities.

```go:main.go
func main() {
    ch := make(chan int)
    go sendData(ch) // goroutine to send data
    go receiveData(ch) // goroutine to receive data
}

func sendData(ch chan<- int) {
    ch <- 42 // send data to the channel
}

func receiveData(ch <-chan int) {
    data := <-ch // receive data from the channel
    // process data
}
```

5. **Memory Model**: Goroutines have access to the same shared memory address space, but they must follow Go's memory model to ensure safe access to shared variables. Synchronization primitives like mutexes and atomic operations are provided to manage access to shared data.

Goroutines are lightweight and efficient, allowing Go programs to achieve high levels of concurrency with relatively low overhead. However, it's important to manage and coordinate goroutines properly to avoid issues like race conditions, deadlocks, and resource leaks.

